import React, { Component } from "react";
import { Provider } from "react-redux";
import { createStore, applyMiddleware } from "redux";
import { BrowserRouter, Route, NavLink } from "react-router-dom";
import ReduxThunk from "redux-thunk";
import reducers from "./reducers";
import {
  defaultRoute,
  settingsRoute,
  profiledRoute,
  dashboardRoute
} from "./config/route";
import Dashboard from "./components/dashboard";
import Settings from "./components/settings";
import "./App.css";
import Body from "./components/common/parent";

class App extends Component {
  render() {
    return (
      <Provider store={createStore(reducers, {}, applyMiddleware(ReduxThunk))}>
        <BrowserRouter>
          <div className="App">
            <NavLink to={defaultRoute}>Profile</NavLink>
            <NavLink to={settingsRoute}>Setting</NavLink>
            <NavLink to={dashboardRoute}>Dashboard</NavLink>
            <Body>
              <Route
                path={defaultRoute}
                exact={true}
                render={() => <h1>profile</h1>}
              />
              <Route path={settingsRoute} exact={true} component={Settings} />
              {/*  <Settings /> */}
              <Route path={dashboardRoute} exact={true} component={Dashboard} />
            </Body>
          </div>
        </BrowserRouter>
      </Provider>
    );
  }

  componentDidMount() {
    //  console.log("[store.getState()]",sto)
  }
}

export default App;
